DROP TABLE IF EXISTS `sl_order`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `sl_order` (
  `id` bigint NOT NULL COMMENT 'id',
  `trading_order_no` bigint DEFAULT NULL COMMENT '交易系统订单号',
  `trading_channel` varchar(50) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '支付渠道',
  `payment_method` tinyint DEFAULT NULL COMMENT '付款方式,1.预结2到付',
  `payment_status` tinyint DEFAULT NULL COMMENT '付款状态,1.未付2已付',
  `amount` decimal(32,2) DEFAULT NULL COMMENT '金额',
  `refund` decimal(12,2) DEFAULT '0.00' COMMENT '退款金额【付款后，单位：元',
  `is_refund` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '是否有退款：YES，NO',
  `order_type` tinyint NOT NULL COMMENT '订单类型，1为同城订单，2为城际订单',
  `pickup_type` tinyint NOT NULL COMMENT '取件类型，1为网点自寄，2为上门取件',
  `member_id` bigint DEFAULT NULL COMMENT '下单客户ID',
  `receiver_member_id` bigint DEFAULT NULL COMMENT '收件人ID',
  `status` int DEFAULT NULL COMMENT '订单状态',
  `receiver_province_id` bigint DEFAULT NULL COMMENT '收件人省份id',
  `receiver_city_id` bigint DEFAULT NULL COMMENT '收件人城市id',
  `receiver_county_id` bigint DEFAULT NULL COMMENT '收件人区县id',
  `receiver_address` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '收件人详细地址',
  `receiver_address_id` bigint DEFAULT NULL COMMENT '收件人地址id',
  `receiver_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '收件人姓名',
  `receiver_phone` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '收件人电话',
  `sender_province_id` bigint DEFAULT NULL COMMENT '发件人省份id',
  `sender_city_id` bigint DEFAULT NULL COMMENT '发件人城市id',
  `sender_county_id` bigint DEFAULT NULL COMMENT '发件人区县id',
  `sender_address` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '发件人详细地址',
  `sender_address_id` bigint DEFAULT NULL COMMENT '发件人地址id',
  `sender_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '发件人姓名',
  `sender_phone` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '发件人电话',
  `current_agency_id` bigint DEFAULT NULL COMMENT '订单当前所属网点',
  `distance` double DEFAULT NULL COMMENT '距离，单位：米',
  `mark` varchar(2000) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '备注',
  `create_time` datetime NOT NULL COMMENT '下单时间',
  `estimated_start_time` datetime DEFAULT NULL COMMENT '预计取件开始时间',
  `estimated_arrival_time` datetime DEFAULT NULL COMMENT '预计到达时间',
  `created` datetime DEFAULT NULL COMMENT '创建时间',
  `updated` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci ROW_FORMAT=DYNAMIC COMMENT='订单';
